import React, { Component } from 'react'

export default class Portfolio extends Component {
    render() {
        return (
            <>
                <div className='my-5 pb-5 text-center'>
                    <h1 classn>Portfolio</h1>
                    <i class="fa fa-star fs-1 "></i>

                </div>
            </>
        )
    }
}
